this.imagePreview = function () {
    /* CONFIG */

    xOffset = 1;
    yOffset = 30;

    // these 2 variable determine popup's distance from the cursor
    // you might want to adjust to get the right result

    /* END CONFIG */
    $("a.preview").hover(function (e) {
        this.t = this.title;
        this.title = "";
        var c = (this.t != "") ? "<br/>" + this.t : "";
        $("#preview").remove(); 
        $("body").append("<p id='preview'><img src='" + this.href + "' alt='Click to Download File' />" + c + "</p>");
        $("#preview")
		    .fadeIn("fast");
        var xPos = ((e.pageX / $(window).width()) * 100);
        if ((xPos > 30) && (xPos < 65))
            $("#preview")
				.css("left", xPos + 2 + "%");	
        else
            $("#preview")
			    .css("left", "30%");
    },
	function () {
	    this.title = this.t;
	    $("#preview").fadeOut("slow");
	});
};

this.imagePreviewMessage = function () {
    /* CONFIG */

    xOffset = 10;
    yOffset = 30;

    // these 2 variable determine popup's distance from the cursor
    // you might want to adjust to get the right result

    /* END CONFIG */
    $("a.previewMessage").hover(function (e) {
        this.t = this.title;
        this.title = "";
        var c = (this.t != "") ? "<br/>" + this.t : "";
        $("body").append("<p id='previewMessage'>Click to Download File</p>");
        $("#previewMessage")
		    .css("top", (e.pageY - xOffset) + "px")
		    .css("left", (e.pageX + yOffset) + "px")
		    .fadeIn("fast");
    },
	function () {
	    this.title = this.t;
	    $("#previewMessage").remove();
	});
	$("a.previewMessage").mousemove(function (e) {
	    $("#previewMessage")
			.css("top", (e.pageY - xOffset) + "px")
		    .css("left", (e.pageX + yOffset) + "px");
    });
};


// starting the script on page load
$(document).ready(function () {
    imagePreview();
    imagePreviewMessage();
});
