//Depends on jQuery
//boot strap from query
jQuery.package = function (ns) {
    ns = ns.split('.');
    var cWindow = window, i;
    while (i = ns.shift()) {
        if (!cWindow[i]) {
            cWindow[i] = {};
        }
        cWindow = cWindow[i];
    }
}

//jQuery functions
$.fn.outerHTML = function () {

    // IE, Chrome & Safari will comply with the non-standard outerHTML, all others (FF) will have a fall-back for cloning
    return (!this.length) ? this : (this[0].outerHTML || (
      function (el) {
          var div = document.createElement('div');
          div.appendChild(el.cloneNode(true));
          var contents = div.innerHTML;
          div = null;
          return contents;
      })(this[0]));

  }

//toggle Panels : like jQuery Accordions but better - allow more than one section to remain open at once
$.fn.togglepanels = function () {
    return this.each(function () {
        $(this).addClass("ui-accordion ui-accordion-icons ui-widget ui-helper-reset")
      .find("h3")
        .addClass("ui-accordion-header ui-helper-reset ui-state-default ui-corner-top ui-corner-bottom")
        .hover(function () { $(this).toggleClass("ui-state-hover"); })
        .prepend('<span class="ui-icon ui-icon-triangle-1-e" style="float:left;"></span>')
        .click(function () {
            $(this)
              .toggleClass("ui-accordion-header-active ui-state-active ui-state-default ui-corner-bottom")
              .find("> .ui-icon").toggleClass("ui-icon-triangle-1-e ui-icon-triangle-1-s").end()
              .next().slideToggle();
            return false;
        })
        .next()
          .addClass("ui-accordion-content ui-helper-reset ui-widget-content ui-corner-bottom")
          .hide();
    });
};

$.fn.createCSSClass = function (selector, style) {
      if (!document.styleSheets) {
          return;
      }

      if (document.getElementsByTagName("head").length == 0) {
          return;
      }

      var stylesheet;
      var mediaType;
      if (document.styleSheets.length > 0) {
          for (i = 0; i < document.styleSheets.length; i++) {
              if (document.styleSheets[i].disabled) {
                  continue;
              }
              var media = document.styleSheets[i].media;
              mediaType = typeof media;

              if (mediaType == "string") {
                  if (media == "" || (media.indexOf("screen") != -1)) {
                      styleSheet = document.styleSheets[i];
                  }
              } else if (mediaType == "object") {
                  if (media.mediaText == "" || (media.mediaText.indexOf("screen") != -1)) {
                      styleSheet = document.styleSheets[i];
                  }
              }

              if (typeof styleSheet != "undefined") {
                  break;
              }
          }
      }

      if (typeof styleSheet == "undefined") {
          var styleSheetElement = document.createElement("style");
          styleSheetElement.type = "text/css";

          document.getElementsByTagName("head")[0].appendChild(styleSheetElement);

          for (i = 0; i < document.styleSheets.length; i++) {
              if (document.styleSheets[i].disabled) {
                  continue;
              }
              styleSheet = document.styleSheets[i];
          }

          var media = styleSheet.media;
          mediaType = typeof media;
      }

      if (mediaType == "string") {
          for (i = 0; i < styleSheet.rules.length; i++) {
              if (styleSheet.rules[i].selectorText.toLowerCase() == selector.toLowerCase()) {
                  styleSheet.rules[i].style.cssText = style;
                  return;
              }
          }

          styleSheet.addRule(selector, style);
      } else if (mediaType == "object") {
          if (styleSheet.cssRules != null){
              for (i = 0; i < styleSheet.cssRules.length; i++) {
                  if (styleSheet.cssRules[i].selectorText.toLowerCase() == selector.toLowerCase()) {
                      styleSheet.cssRules[i].style.cssText = style;
                      return;
                  }
              }
          }
    
          styleSheet.insertRule(selector + "{" + style + "}", 0);
      }
  }

